import React from 'react';
import { View, Text, Button, ImageBackground } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack';
import Driving from '../pages/Driving';
import Energy from '../pages/Energy';
import Navbar from '../Navbar';
import Footer from '../Footer';

const Stack = createStackNavigator();

function TrackOptions({ navigation }) {
    return (
        <ImageBackground source={require("../../../assets/ecoBackground.png")} style={styles.container}>
            <Navbar />
            <Text>Choose an option:</Text>
            <Button
                title="Driving"
                onPress={() => navigation.navigate('Driving')}
            />
            <Button
                title="Energy"
                onPress={() => navigation.navigate('Energy')}
            />
            <Footer navigation={navigation} />
        </ImageBackground>
    );
}

function TrackNav() {
    return (
        <View style={{ flex: 1 }}>
            <Stack.Navigator initialRouteName="Track">
                <Stack.Screen
                    name="Track"
                    component={TrackOptions}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Driving"
                    component={Driving}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Energy"
                    component={Energy}
                    options={{ headerShown: false }}
                />
            </Stack.Navigator>
        </View>
    );
}

export default TrackNav;
